[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX clinvar: <http://purl.jp/bio/10/clinvar/>

SELECT (COUNT(DISTINCT ?variant) AS ?snv_count)
WHERE {
  ?variant a clinvar:VariationArchiveType ;
           clinvar:variation_type "single nucleotide variant" .
}
"}}]

[{"name": "mcp__togomcp__search_chembl_target", "input": {"query": "kinase", "limit": 20}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?moleculeLabel ?chemblId ?target ?targetLabel ?ic50Value
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  FILTER(xsd:decimal(?ic50Value) < 100)
}
ORDER BY ?ic50Value
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?chemblId ?moleculeLabel ?targetLabel ?ic50Value
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  FILTER(xsd:decimal(?ic50Value) > 0 && xsd:decimal(?ic50Value) < 100)
}
ORDER BY ?ic50Value
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT (COUNT(DISTINCT ?molecule) as ?unique_molecules) 
       (COUNT(DISTINCT ?target) as ?unique_targets)
       (COUNT(*) as ?total_activities)
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  FILTER(xsd:decimal(?ic50Value) > 0 && xsd:decimal(?ic50Value) < 100)
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?targetLabel (COUNT(DISTINCT ?molecule) as ?molecule_count)
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  FILTER(xsd:decimal(?ic50Value) > 0 && xsd:decimal(?ic50Value) < 100)
}
GROUP BY ?targetLabel
ORDER BY DESC(?molecule_count)
LIMIT 30"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?chemblId ?moleculeLabel ?targetLabel ?ic50Value ?pChembl
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  VALUES ?targetName { 
    "Tyrosine-protein kinase JAK2"
    "Serine/threonine-protein kinase B-raf"
    "Tyrosine-protein kinase BTK"
    "MAP kinase ERK2"
    "Serine/threonine-protein kinase mTOR"
    "PI3-kinase p110-alpha subunit"
    "Tyrosine-protein kinase SYK"
  }
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  OPTIONAL { ?activity cco:pChembl ?pChembl }
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .
  FILTER(?targetLabel = ?targetName)
  FILTER(xsd:decimal(?ic50Value) > 0 && xsd:decimal(?ic50Value) < 10)
}
ORDER BY ?targetLabel ?ic50Value
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?chemblId ?moleculeLabel ?targetLabel ?ic50Value ?pChembl
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  OPTIONAL { ?activity cco:pChembl ?pChembl }
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  FILTER(xsd:decimal(?ic50Value) > 0.1 && xsd:decimal(?ic50Value) < 10)
}
ORDER BY ?ic50Value
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?chemblId ?moleculeLabel ?targetLabel ?ic50Value ?developmentPhase
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId ;
            cco:highestDevelopmentPhase ?developmentPhase .
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  FILTER(xsd:decimal(?ic50Value) > 0 && xsd:decimal(?ic50Value) < 100)
  FILTER(?developmentPhase >= 3)
}
ORDER BY DESC(?developmentPhase) ?ic50Value
LIMIT 50"}}]
